import React, { Component } from 'react';
import {
    OwpButton,
    OwpSearchDateTimePickerMulti,
    OwpPageCarded,
    OwpSearchHeader,
    OwpSearchSelectField,
    OwpSearchTextField,
    OwpToolbar,
    OwpTreeGrid,
    OwpSearchAutoComplete,
} from 'owp/wrapper';
import * as TGEvent from 'owp/TGEvent';
import Pop_C1304001 from '../../include/Pop_C1304001';

class Page extends Component {
    constructor(props) {
        super(props);
        this.state = {};
    }


    render() {
        return (
            <React.Fragment>
                <OwpPageCarded
                    header={
                        <OwpSearchHeader url="listOwpProdplan">
                            <OwpSearchAutoComplete
                                className="w-160"
                                id={'sm01'}
                                name={'sm01'}
                                label={'보호구명'}
                            />
                        
                            <OwpSearchAutoComplete
                                className="w-160"
                                id={'sm03'}
                                name={'sm03'}
                                label={'보호구코드'}
                                
                            />
                            <OwpSearchSelectField
                                className="w-160"
                                id={'sm05'}
                                name={'sm05'}
                                label="보호구구분"
                                options={[
                                    { label: '전체', value: '1' },
                                    { label: '전체', value: '2' },
                                ]}
                                value={'1'}
                            />
                            <OwpSearchSelectField
                                className="w-160"
                                id={'sm05'}
                                name={'sm05'}
                                label="제조사"
                                useAll
                            />
                            <OwpSearchSelectField
                                className="w-160"
                                id={'sm05'}
                                name={'sm05'}
                                label="유해성"
                                options={[
                                    { label: '전체', value: '1' },
                                    { label: '전체', value: '2' },
                                ]}
                                value={'1'}
                            />
                            <OwpSearchSelectField
                                className="w-160"
                                id={'sm05'}
                                name={'sm05'}
                                label="노출기준"
                                options={[
                                    { label: '전체', value: '1' },
                                    { label: '전체', value: '2' },
                                ]}
                                value={'1'}
                            />
                        </OwpSearchHeader>
                    }
                    contentToolbar={
                        <OwpToolbar title="설비/장비 관리">
                            <Pop_C1304001/>
                            <OwpButton color={'secondary'} variant={'contained'}>
                            수정
                            </OwpButton>
                            <OwpButton color={'secondary'} variant={'contained'}>
                            삭제
                            </OwpButton>
                        </OwpToolbar>
                    }
                    content={
                        <React.Fragment>
                            <OwpTreeGrid
                                id="C1304001"
                                LayoutUrl={'/assets/data/C1304001Def.xml'}
                                DataUrl={'/assets/data/C0202000Data.xml'}
                            />
                        </React.Fragment>
                    }
                    innerScroll
                />
            </React.Fragment>
        );
    }
}

export default Page;
